import React from 'react'
import'./Main.css';


function Main() {
  return (
    <div className="card">
      <div class='cards'>
      <div class='card1'><img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fdynamic-assets.coinbase.com%2F3c15df5e2ac7d4abbe9499ed9335041f00c620f28e8de2f93474a9f432058742cdf4674bd43f309e69778a26969372310135be97eb183d91c492154176d455b8%2Fasset_icons%2F9d67b728b6c8f457717154b3a35f9ddc702eae7e76c4684ee39302c4d7fd0bb8.png&tbnid=0a2iKQmmF8Vs5M&vet=12ahUKEwj76OfUuviBAxWb2zgGHViMB18QMygVegQIARB2..i&imgrefurl=https%3A%2F%2Fwww.coinbase.com%2Fprice%2Fusdc&docid=ZNXSFu-1Uk8KOM&w=600&h=600&q=usd%20coin%20cryptocurrency&hl=en&ved=2ahUKEwj76OfUuviBAxWb2zgGHViMB18QMygVegQIARB2"/> card1</div>
      <div class='card2'>card2</div>   
      <div class='card3'>card3</div>
      <div class='card3'>card4</div>
    </div>
    </div>
  )
}

export default Main;
